import React, { Component } from 'react'

class WeeklyPlanner extends Component {
    constructor(props) {
        super(props);
        this.state = {
            goals: null
        };
    }

    componentDidMount() {
        fetch('/weeks/1')
            .then(res => res.json())
            .then(weeks => this.setState({goals: weeks.goals}));
    }

    render() {
        const { goals } = this.state;
        const display = goals ? <p>goals</p> : <p>loading...</p>
        return (
            display
        )
    }
}

export default WeeklyPlanner;
